[{"location":"","page":"Home","title":"Home","text":"CurrentModule = CentralDiff","category":"page"},{"location":"#CentralDiff","page":"Home","title":"CentralDiff","text":"","category":"section"},{"location":"","page":"Home","title":"Home","text":"Documentation for CentralDiff.","category":"page"},{"location":"","page":"Home","title":"Home","text":"","category":"page"},{"location":"","page":"Home","title":"Home","text":"Modules = [CentralDiff, CentralDiff.Operators, CentralDiff.Simple]","category":"page"},{"location":"#CentralDiff.AbstractAxis","page":"Home","title":"CentralDiff.AbstractAxis","text":"AbstractAxis\n\nAn abstract type representing an axis. It serves as the base type for XAxis, YAxis, and ZAxis.\n\n\n\n\n\n","category":"type"},{"location":"#CentralDiff.Order","page":"Home","title":"CentralDiff.Order","text":"Order{N}()\nOrder(N)\n\nRepresent the order of a numerical method. N is an integer constant specifying the order.\n\n\n\n\n\n","category":"type"},{"location":"#CentralDiff.dI","page":"Home","title":"CentralDiff.dI","text":"dI{T<:AbstractAxis}(axis, stride)\n\nRepresent a displacement along a specific axis.\n\nExamples\n\n```jldoctest julia> CartesianIndex(1, 1) + dI(XAxis(), 2) CartesianIndex(3, 1)\n\njulia> CartesianIndex(1, 1) + dI(YAxis(), 2) CartesianIndex(1, 3)\n\njulia> CartesianIndex(1, 1, 1) + dI(ZAxis(), 3) CartesianIndex(1, 1, 4)\n\n\n\n\n\n","category":"type"},{"location":"#CentralDiff.TaylorMatrix-Tuple{Any}","page":"Home","title":"CentralDiff.TaylorMatrix","text":"TaylorMatrix(samples)\n\nConstruct a Taylor matrix from the given sample points. Returns a matrix where element (i,j) is i^j / j!.\n\nExample\n\njulia> A = TaylorMatrix(-3//2:3//2)\n4×4 Matrix{Rational{Int64}}:\n 1  -3//2  9//8  -9//16\n 1  -1//2  1//8  -1//48\n 1   1//2  1//8   1//48\n 1   3//2  9//8   9//16\n\njulia> iA = inv(A)\n4×4 Matrix{Rational{Int64}}:\n -1//16   9//16   9//16  -1//16\n  1//24  -9//8    9//8   -1//24\n  1//2   -1//2   -1//2    1//2\n  -1       3      -3       1\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff._generate_terms-Tuple{Any}","page":"Home","title":"CentralDiff._generate_terms","text":"_generate_terms(C)\n\nGenerate expressions for finite difference or interpolation terms. Returns a vector of expressions based on coefficient vector C.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff._shift_and_add-Tuple{Any, Any}","page":"Home","title":"CentralDiff._shift_and_add","text":"_shift_and_add(C1, C2)\n\nCompute the convolution of two coefficient vectors C1 and C2. Returns a vector of length 2N-1, where N is the length of C1 and C2.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.countorder-Tuple{Any, Vararg{Any}}","page":"Home","title":"CentralDiff.countorder","text":"countorder(f, hs...)\n\nCompute convergence orders for a function over multiple grid spacings. Returns computed orders as a NamedTuple or vector.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.d2fdx-Union{Tuple{N}, Tuple{Order{N}, Any, Any}} where N","page":"Home","title":"CentralDiff.d2fdx","text":"d2fdx(order, F, dxi)\nd2fdx(order, axis, F, I, dxi)\n\nCompute second derivative of order N along axis at i.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.dfdx-Union{Tuple{N}, Tuple{Order{N}, Any, Any}} where N","page":"Home","title":"CentralDiff.dfdx","text":"dfdx(order, F, dxi)\ndfdx(order, axis, F, I, dxi)\n\nCompute first derivative of order N along axis at i.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.dfdxc-Union{Tuple{N}, Tuple{Order{N}, Any, Any}} where N","page":"Home","title":"CentralDiff.dfdxc","text":"dfdxc(order, F, dxi)\ndfdxc(order, axis, F, I, dxi)\ndfdxc(order, axis, diff, F, I, dxi)\n\nCompute first derivative of order N along axis at i+1/2 (default, forward) or i-1/2 (backward).\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.fc-Union{Tuple{N}, Tuple{Order{N}, Any}} where N","page":"Home","title":"CentralDiff.fc","text":"fc(order, F)\nfc(order, axis, F, I)\nfc(order, axis, diff, F, I)\n\nCompute interpolation of order N along axis at i+1/2 (default, forward) or i-1/2 (backward).\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.Operators.f̄n-NTuple{4, Any}","page":"Home","title":"CentralDiff.Operators.f̄n","text":"f̄n(n, axis, F, I)\nf̄n(n, axis, diff, F, I)\n\nCompute centered average at i+1/2 (default, forward) or i-1/2 (backward) over n points along specified axis. f̄1, f̄3, f̄5, ..., f̄19 for specific n values available.\n\n\n\n\n\n","category":"method"},{"location":"#CentralDiff.Operators.δfδxn-NTuple{5, Any}","page":"Home","title":"CentralDiff.Operators.δfδxn","text":"δfδxn(n, axis, F, I, dxi)\nδfδxn(n, axis, diff, F, I, dxi)\n\nCompute centered difference at i+1/2 (default, forward) or i-1/2 (backward) over n points along specified axis. δfδx1, δfδx3, δfδx5, ..., δfδx19 for specific n values available.\n\n\n\n\n\n","category":"method"}]
